INSERT INTO `book` VALUES (10, '平凡的世界 ', '路遥著 ', '北京十月文艺出版社2012 ', '/LibrarySeatSystem/upload/book/1461066939130.jpg', '《平凡的世界(套装共3册)》是一部现实主义小说，也是小说化的家族史。作家高度浓缩了中国西北农村的历史变迁过程，作品达到了思想性与艺术性的高度统一，特别是主人公面对困境艰苦奋斗的精神，对今天的大学生朋友仍有启迪。这是一部全景式地表现中国当代城乡社会生活的长篇小说。《平凡的 世界(套装共3册)》共三部。作者在近十年问广阔背景上，通过复杂的矛盾纠葛，刻画了社会各阶层众多普通人的形象。劳动与爱情，挫折与追求，痛苦与欢乐，日常生活与巨大社会冲突，纷繁地交织在一起，深刻地展示了普通人在大时代历史进程中所走过的艰难曲折的道路。', 'I247.57/6732 ', 94, 2);
INSERT INTO `book` VALUES (11, '琅琊榜 ', '海宴著 ', '四川文艺出版社2014.05 ', '/LibrarySeatSys/upload/book/1557498770921.jpg', '一卷风云琅琊榜，囊尽天下奇英才。 他远在江湖，却能名动帝辇，只因神秘莫测而又言出必准的琅琊阁，突然断言他是“麒麟之才，得之可得天下”。 然而，身为太子与誉王竞相拉拢招揽的对象，他竟然出人意料地舍弃了这两个皇位争夺的热门人选，转而投向默默无闻、最不受皇帝宠爱的靖王。 这是想挑战自己的麒麟之才？还是其中内有隐情？ 那雪夜薄甲、逐敌千里的少年将军，和病骨支离、年寿难永的阴沉谋士，究竟哪一个是他最真实的一面？宫廷内外，无数的谜团交织在刀光血影中，尔谀我诈中带出一段段离奇的故事。太子、誉王与靖王，互相的势力此消彼长，精彩绝伦的权术争斗你来我往。大江南北，各路精英纷纷登场，有背负双重身份的贵公子，有统帅南境铁骑的美丽郡主，有手握禁军的国中第一高手，有身陷家仇国恨的烟花女子，有性格乖戾的影子高手，有默默隐忍的朝中要臣…… 权谋、仇恨、感情……互相交织，层层发展，逐渐撕开事实的真相，然而，一切真相大白后，故事却又朝着不可思议的方向继续发展…', 'I247.53/3830 ', 82, 2);
INSERT INTO `book` VALUES (12, '百年孤独 ', '加西亚·马尔克斯著 ', '南海出版公司2011 ', '/LibrarySeatSystem/upload/book/1461067094948.jpg', '《百年孤独》是魔幻现实主义文学的代表作，描写了布恩迪亚家族七代人的传奇故事，以及加勒比海沿岸小镇马孔多的百年兴衰，反映了拉丁美洲一个世纪以来风云变幻的历史。作品融入神话传说、民间故事、宗教典故等神秘因素，巧妙地糅合了现实与虚幻，展现出一个瑰丽的想象世界，成为20世纪最重要的经典文学巨著之一。1982年加西亚？马尔克斯获得诺贝尔文学奖，奠定世界级文学大师的地位，很大程度上乃是凭借《百年孤独》的巨大影响。', 'I775.457/7724 ', 52, 2);
INSERT INTO `book` VALUES (13, '蛙 ', '莫言著 ', '作家出版社2012 ', NULL, '2011年8月20日，莫言小说《蛙》获得第八届茅盾文学奖。小说由剧作家蝌蚪写给日本作家杉谷义人的四封长信和一部话剧构成，以新中国近60年波澜起伏的农村生育史为背景，通过讲述从事妇产科工作50多年的乡村女医生姑姑的人生经历，讲述了姑姑——一个乡村妇产科医生的人生经历，在用生动感人的细节展示乡土中国六十年波澜起伏的生育史的同时，毫不留情地剖析了当代知识分子卑微的灵魂。在形象描述国家为了控制人口剧烈增长、实施计划生育国策所走过的艰巨而复杂的历史过程的同时，成功塑造了一个生动鲜明、感人至深的农村妇科医生形象。 《蛙》是莫言酝酿十余年、笔耕四载、三易其稿、潜心打造的一部触及国人灵魂最痛处的长篇力作。', 'I247.57/4400 ', 47, 2);
