INSERT INTO `notice` VALUES (1, '图书馆服务创新团队走进学院机关的系列报道之三', '<p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\">原标题：巴西众议院总统弹劾案投票达到通过票数罗塞夫将被停职</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\">国际在线专稿 据巴西《圣保罗页报》报道，17日晚，巴西众议院513名议员中已有至少342名议员对弹劾总统罗塞夫投了赞成票，这意味着弹劾总统程序将继续，弹劾报告将递交给参议院做出最终表决。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\">据此前媒体报道，在参议院审理弹劾案的180天内，罗塞夫将暂停总统职务，由副总统特梅尔代理。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\">据悉，从巴西当地时间4月15日早上开始一直到17日清晨，有120名议员参加了关于是否弹劾罗塞夫的辩论，辩论时间超过43个小时。</p><p class=\"ifengMore\" style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; height: 21px; position: relative; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; background: url(&quot;http://y2.ifengimg.com/a/2015/0708/icon_more.gif&quot;) 0% 0% no-repeat rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\">4月12日，巴西国会众议院劾委员会通过了支持弹劾罗塞夫总统的报告。这意味着弹劾总统的程序已然启动，随后巴西的众议院参议院将先后投票表决。罗塞夫最快或在月内就将被暂停职务。</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\">罗塞夫自去年起就危机重重，反对党指责她在2014年竞选连任时政府账务作假，并在2015年隐瞒巴西的衰退程度（2015年巴西经济缩水了3.8%）。更令罗塞夫头疼的是号称“巴西史上最大贪腐丑闻”的巴西石油腐败案。2014年该公司前任高管被查，他供出超过30名巴西国会议员涉案，随后罗塞夫也被指涉案。巴西石油公司仅去年第四季度一个季度就亏损了100亿美元</p><p style=\"margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\">罗塞夫身陷危机之中却并不“收手”。今年3月，她不顾朝野反对任命自己的恩师、前总统卢拉担任总统办公室主任。卢拉同样被指涉巴西石油弊，此前已经遭当地检方起诉。而他担任总统办公室主任则可以获得内阁豁免权，在短期内无法被传唤和拘捕。</p><p><br/></p>', '2019-04-18 19:51:48');
INSERT INTO `notice` VALUES (2, '李克强：深化教育改革激发更大活力 贯彻创新战略赢得发展未来', '<p style=\"margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">4月15日，中共中央政治局常委、国务院总理李克强在北京召开高等教育改革创新座谈会，并作重要讲话。53所在京的部属、市属、民办高校和有关部门负责人参加会议。</p><p style=\"text-align:center;margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"http://www.gov.cn/premier/2016-04/17/5065095/images/092c2c156fe2459785481ca8926db36b.jpg\" border=\"0\" align=\"center\" style=\"border: none; margin: 0px; padding: 0px;\"/><br/></p><p style=\"margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">会上，北京大学、清华大学、北京科技大学主要负责人和中国人民大学、北京第二外国语学院教师代表就教育改革、创新人才培养、建设一流大学和一流学科等发了言。李克强说，<strong>教育是国家发展的基础，关系民族的未来，高水平教育是国家综合竞争力的重要体现。</strong>世界经济强国，无一不是教育强国。中华文明几千年生生不息，根本在于重视教育。改革开放以来，我们始终坚持教育优先发展，举办了世界最大规模的高等教育，成为推动经济发展和社会进步的重要力量。面对当前国际政治经济形势变化和新一轮科技革命的兴起，教育要全面贯彻党的教育方针，培养中国特色社会主义事业建设者和接班人，在促进经济保持中高速增长、迈向中高端水平，跨越中等收入陷阱，实现全面建成小康社会的征程中担负更大责任、发挥支撑作用。</p><p style=\"text-align:center;margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"http://www.gov.cn/premier/2016-04/17/5065095/images/5d7c14b42adb4c3fbab5a5578a5e81c8.jpg\" border=\"0\" align=\"center\" style=\"border: none; margin: 0px; padding: 0px;\"/><br/></p><p style=\"margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">李克强说，<strong>创新是推动国家发展和社会进步的不竭动力。当今世界各国的竞争，实际上是创新的竞争。党的十八大以来，以习近平同志为总书记的党中央坚持实施创新驱动发展战略，就是要把蕴藏在亿万民众中的创造力发挥出来。高等教育要着力围绕服务国家创新发展，促进大众创业、万众创新，培育更多创新型人才。</strong>注重培养学生创新特别是原始创新意识，开展启发式、讨论式、探究式教学，激发他们丰富的想象力，打牢知识根基，拓宽学术视野，推动科技创新。注重增强学生实践能力，培育工匠精神，践行知行合一，多为学生提供动手机会，提高解决实际问题的能力，助力提升中国产品的质量。注重推动教育公平，继续对农村和贫困地区学生上重点大学实行倾斜，让更多困难家庭孩子能够受到良好教育，在平等竞争中拥有上升通道、释放创造潜能。</p><p style=\"margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">李克强指出，<strong>要加快建设一批高水平大学。</strong>国家确定了推进世界一流大学和一流学科建设的重大举措，鼓励公办民办各类学校办出特色、分类发展。当前要抓紧出台促进一流学科建设的具体措施，在政策和资金上给予精准支持。通过一流学科率先突破，示范和带动提升我国高等教育综合实力和国际竞争力，促进壮大新经济、培育新动能，推动文化繁荣和社会进步。</p><p style=\"text-align:center;margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"http://www.gov.cn/premier/2016-04/17/5065095/images/e6c5961315a045e0b0fbe13a0f7114fd.jpg\" border=\"0\" align=\"center\" style=\"border: none; margin: 0px; padding: 0px;\"/><br/></p><p style=\"margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">李克强说，<strong>要加快推进高等教育领域“放、管、服”改革。结合高校特点，简除烦苛，给学校更大办学自主权。</strong>凡高校能够依法自主管理的，相关行政审批权该下放的下放，要抓紧修改或废止不合时宜的行政法规和政策文件，破除制约学校发展的不合理束缚。同时，有关部门要完善督导监管，积极探索为学校、教师、学生服务的新途径、新方式。各级党委、政府要健全制度，完善政策，为教育发展创造更好环境。</p><p style=\"margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">李克强强调，<strong>建设高水平大学要充分调动广大教学和科研人员的积极性。</strong>健全教师评价制度，对教学、科研人员包括兼任行政职务的专家教授，实行符合智力劳动特点和规律的政策，不能简单套用针对行政人员的规定和经费管理办法，充分体现尊重知识、尊重人才的要求，给教学和科研人员更多经费使用权，更多创新成果使用、处置和收益权，更好调动广大知识分子的积极性和创造性。要积极提携后进，为青年教师施展才华提供舞台，帮助他们解决实际困难，形成青蓝相继、人才辈出的局面，推动教育强国建设。</p><p style=\"margin-top: 15px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: 宋体; font-size: 12pt; line-height: 30px; white-space: normal; text-indent: 2em; background-color: rgb(255, 255, 255);\">刘延东主持座谈会，郭金龙、杨晶参加。</p><p><br/></p>', '2019-04-18 19:53:47');
